// frontend/src/components/Apod.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';
import {
    Button,
    Container,
    TextField,
    Typography,
    Card,
    CardMedia,
    CardContent,
    Snackbar,
} from '@mui/material';
import { motion } from 'framer-motion';
import './Apod.css'; // Import the CSS file for background styling

const Apod = () => {
    const [apodData, setApodData] = useState(null);
    const [date, setDate] = useState('');
    const [error, setError] = useState('');

    const fetchApodData = async (date) => {
        setError('');
        const today = new Date().toISOString().split('T')[0];

        // Prevent fetching data for future dates
        if (date > today) {
            setError('Please select a date that is today or in the past.');
            return;
        }

        try {
            const response = await axios.get(`http://localhost:5004/apod?date=${date}`);
            setApodData(response.data);
        } catch (err) {
            setError('Error fetching APOD data.');
        }
    };

    const handleDateChange = (e) => {
        setDate(e.target.value);
    };

    const handleFetchClick = () => {
        fetchApodData(date);
    };

    useEffect(() => {
        const today = new Date().toISOString().split('T')[0];
        fetchApodData(today); // Fetch today's APOD on component mount
    }, []);

    const today = new Date().toISOString().split('T')[0];

    return (
        <Container sx={{ textAlign: 'center', padding: '40px', minHeight: '100vh' }} className="apod-background">
            <Typography variant="h3" gutterBottom color="white">Astronomy Picture of the Day</Typography>
            <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', marginBottom: '20px' }}>
                <TextField
                    type="date"
                    value={date}
                    onChange={handleDateChange}
                    inputProps={{ max: today }} // Disable future dates
                    sx={{ marginRight: '25px', width: '200px' }} // Set width for input field
                    variant="outlined"
                    color="primary"
                />
                <motion.div
                    whileHover={{ scale: 1.1, boxShadow: '0px 0px 8px rgba(255, 255, 255, 0.8)' }} // Button hover animation
                    whileTap={{ scale: 0.95 }} // Button press animation
                >
                    <Button variant="contained" color="primary" onClick={handleFetchClick} sx={{ width: '250px' }}> {/* Match button width */}
                        Fetch for Selected Date
                    </Button>
                </motion.div>
            </div>

            {error && (
                <Snackbar
                    open={Boolean(error)}
                    autoHideDuration={6000}
                    message={error}
                    onClose={() => setError('')}
                />
            )}

            {apodData && (
                <motion.div
                    initial={{ opacity: 0, y: -50 }} // Slide in from above
                    animate={{ opacity: 1, y: 0 }} // Slide to position
                    exit={{ opacity: 0, y: 50 }} // Slide out when unmounted
                    transition={{ duration: 0.5 }}
                >
                    <Card sx={{ marginTop: '20px', borderRadius: '15px', overflow: 'hidden' }}>
                        <CardMedia
                            component="img"
                            height="600" // Increase height for a larger view
                            image={apodData.url}
                            alt={apodData.title}
                            sx={{ filter: 'brightness(0.8)' }} // Slightly darken the image
                        />
                        <CardContent sx={{ background: 'rgba(255, 255, 255, 0.8)' }}>
                            <Typography variant="h5" sx={{ fontWeight: 'bold', textAlign: 'center' }}>{apodData.title}</Typography>
                            <Typography variant="subtitle1" color="textSecondary">{apodData.date}</Typography>
                            <Typography variant="body2">{apodData.explanation}</Typography>
                            {apodData.hdurl && (
                                <motion.div
                                    whileHover={{ scale: 1.1 }}
                                    whileTap={{ scale: 0.95 }}
                                >
                                    <Button variant="outlined" href={apodData.hdurl} target="_blank" rel="noopener noreferrer" sx={{ marginTop: '10px' }}>
                                        View HD Image
                                    </Button>
                                </motion.div>
                            )}
                        </CardContent>
                    </Card>
                </motion.div>
            )}
        </Container>
    );
};

export default Apod;
